import React from 'react';
import Layout from '../../Components/Layout/Layout'
import { Container } from 'react-bootstrap'

const Summary = (props) => {
    const { state } = props.location;
    return (
        <Layout>
            <div className="mainDiv">
                <Container>
                    Summary
                    {
                        state.modelId
                    }

                </Container>
            </div>
        </Layout>
    );
};

export default Summary;
